            {productId: 5, name: 'Fender Vintera 50s Telecaster ', price: '$ 899,99', color: 'Красный', country:'США', conf: 'SS', photo: 'https://www.swingcitymusic.com/wp-content/uploads/2019/09/0149852340_gtr_frt_001_rr.png', availability: 'available',},
            {productId: 6, name: 'Fender Squier Affinity Stratocaster', price: '$ 199,99', color: 'Зеленый', country:'США', conf: 'SSS', photo: 'https://images.squarespace-cdn.com/content/v1/55873fffe4b0e842044c4c9a/1513135287578-2DZDTHHWXSBNOTYD4UNY/ke17ZwdGBToddI8pDm48kFq-5U1G4ycqfjHitUPuTvoUqsxRUqqbr1mOJYKfIPR7LoDQ9mXPOjoJoqy81S2I8PaoYXhp6HxIwZIk7-Mi3Tsic-L2IOPH3Dwrhl-Ne3Z2N30YpliarI2Ls62HzKmeQ8kpxrTH6M4X-G_zkZGSRnAKMshLAGzx4R3EDFOm1kBS/Squier+Affinity+Strat+Surf+Green+Front.png', availability: 'available'},
